import React from 'react';
import { NavLink } from 'react-router-dom';
import logo from '../imagini/A.png'

function Nav() {
  return (
    <> <li className="w-full">
    <NavLink to="/" className={({ isActive }) => isActive ? 'text-yellow-500  btn' : 'btn'}><img className='ml-5 w-32 h-32' 
    style={{borderRadius:'50%'}}
    src={logo} alt="logo"/></NavLink>
  </li>
    <nav className="bg-gray-600 text-white w-full">
      <ul className="flex flex-col md:flex-row md:justify-between font-bold">
       
       
       
        <li className="w-full">
          <NavLink to="/teorie/introducere" className={({ isActive }) => isActive ? 'text-yellow-500 btn' : 'btn'}>Teorie</NavLink>
        </li>
        <li className="w-full">
          <NavLink to="/laborator" className={({ isActive }) => isActive ? 'text-yellow-500 btn' : 'btn'}>Palete</NavLink>
        </li>
        <li className="w-full">
          <NavLink to="/quizz-uri" className={({ isActive }) => isActive ? 'text-yellow-500 btn' : 'btn'}>Quiz-uri</NavLink>
        </li>
        <li className="w-full">
          <NavLink to="/joc" className={({ isActive }) => isActive ? 'text-pink-300 btn bg-slate-800 rounded-xl' : 'btn'}>Joc</NavLink>
        </li>
        
       
      </ul>
    </nav>
    </>
  );
}

export default Nav;
